import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./pages/home";
import { RecipesProvider } from "./services/Context";


function App() {
  return (
     <RecipesProvider>
       <Router>

      <div className="App">

        <Navbar />
        <Home />
      </div>
       </Router>
     </RecipesProvider>


  );
}

export default App;
